import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  width: 400px;
  margin: 100px auto 40px;
  display: flex;
  flex-direction: column;
`;

function JoinSpace() {
  return (
    <div>
      <header>
        <img alt="이전" />
        <div>가입하기</div>
      </header>
      <div>
        <div>이메일</div>
        <div>비밀번호</div>
        <button>회원가입</button>
      </div>
    </div>
  );
}

export default JoinSpace;
